const Form = () => {
     return(
        <>
         <div className="main-div">
           <Form>
             <h1> Hello </h1>
             <input type = "text" placeholder="Enter your Name" />
              <br/>
              <button> Click me</button>
           </Form> 
         </div>
        </> 
     );
};

export default Form;
